import { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redaux';
import getProductCatalog from '../store/actions/productCatalogActions';

const Products = () => {

    const dispatch = useDispatch();

    useEffect(() => {
        dispatch()
    })
    return (
        <div>
            Products
        </div>
    )
}

export default Products
